import React from "react";
import purchase from "../svg/Purchase.svg";
import register from "../svg/register.svg";

export default function PIcon() {
  return (
    <footer style="display: flex; justify-content: flex-end;">
      <div class="btn-purchase" style="margin-right: 10px;">
        <a href="Purchase.html">
          <img src={purchase} alt="purchase" width="50" height="50" />
        </a>
      </div>
      <div class="btn-product_registration">
        <a href="product_registration.html">
          <img src={register} alt="register" width="50" height="50" />
        </a>
      </div>
    </footer>
  );
}
